import Banner from "../components/Posts";
export default function() {
  return (
    <div>
      <h1>Data:</h1>
      <ApolloProvider client={client}>
        <KeystoneProvider>
          <Query
            query={gql`
              query {
                allProducts {
                  title
                }
              }
            `}
          >
            {({ data }) => <pre>{JSON.stringify(data)}</pre>}
          </Query>
        </KeystoneProvider>
      </ApolloProvider>
    </div>
  );
}
